- entries:
  - jsonPayload:
      non-overwritten-field: non-overwritten
      original-field: original-value
      overwritten-field: overwritten
      parsed-field: parsed-value
    labels:
      non-overwritten-label: non-overwritten
      original-label: original-label
      overwritten-label: overwritten
      parsed-label: parsed-label
    logName: projects/my-project/logs/my-log-name
    resource:
      labels:
        instance_id: test-instance-id
        zone: test-zone
      type: gce_instance
    sourceLocation:
      file: overwritten-file-path
    timestamp: now
  partialSuccess: true
- collector_errors:
  - caller: localhostgate/featuregate.go:63
    feature gate ID: component.UseLocalHostAsDefaultHost
    level: warn
    msg: The default endpoints for all servers in components will change to use localhost instead of 0.0.0.0 in a future version. Use the feature gate to preview the new default.
